  selector: 'app-menu',
  templateUrl: './menu.component.html',
  styleUrls: ['./menu.component.css']
})
export class MenuComponent {
  constructor() { }
}
<p>menu works!</p>
<mat-card>
  <mat-card-content>Simple card</mat-card-content>
</mat-card>
